import React from 'react';
import logo from './logo.svg';
import './App.css';
import aboutImage from './about.jpg';

function About() {
  return (
    <div className='about-container'>
      <h2>About</h2>
      <article className='card'>
        <img className='team-photo' src={aboutImage} />
      </article>
    </div>
  );
}

export default About;
